window.bookSummaryJSON = "<p>Lt. Reilly is back. He took the job that Mitchell offered him in the Military Investigations office on New Harmony, got his commission reinstated, and finally had a chance to figure out his relationship with Kayla. Yet one of his cases turned out to be much, much bigger than he expected it to be. He and Mitchell soon find themselves in the middle of a black-ops cover-up, intergalactic conspiracy, and the beginnings of a new war that threatens to rip the Alliance apart from within.</p>"; 
